import React from 'react';
import Tween from 'rc-tween-one';

function Twn({x}){
    return(
        <Tween
                    key='tweenOne2'
                    reverseDelay={4000}
                    component={'section'}
                    animation={[
                    {
                        delay: 0,
                        duration: 1000,
                        opacity: 0,
                        x: 0,
                        top: 0,
                        ease: "linear",
                        backgroundColor: x.cor2
                    }, {
                        delay: 1000,
                        duration: 300,
                        opacity: 1,
                        x: 0,
                        y: '0',
                        top: 0,
                        ease: "easeOutCirc",
                        backgroundColor: '#fff'
                    }
                ]}
                    style={{
                    opacity: 0,
                    transform: 'translateY(0)',
                    backgroundColor: '#fff',
                    top: '0vh'
                }}
                    className={"tween-one cabecalho"}>
        <h1 style={{
            color: x.cor2
        }}>{x.letra}</h1>
        <label>{x.label}</label>
        <h2>{x.h2}</h2>
        <div className='descricao'>{x.descricao}</div>
        </Tween>
    )
}


export default Home;
